import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';

import SearchPage from './SearchPage';
import ResultPage from './ResultPage';
import JobDetailPage from './JobDetailPage';
import TrendingPage from './TrendingPage';  // Menambahkan halaman Tren Pencarian

export default function App() {
  return (
    <Router>
      <div className="app-container">
        {/* Menu Tren Pencarian */}
        <div className="menu-tren-container">
          <a href="/tren" className="btn-tren">Tren Pencarian</a>
        </div>

        <Routes>
          <Route path="/" element={<SearchPage />} />
          <Route path="/results" element={<ResultPage />} />
          <Route path="/job-detail" element={<JobDetailPage />} />
          <Route path="/tren" element={<TrendingPage />} /> {/* Halaman tren */}
        </Routes>
      </div>
    </Router>
  );
}
